#include <iostream>
#include <algorithm>
#include <vector>

using namespace std;

class Solution {
public:
    int longestConsecutive(vector<int>& nums) {
        if(nums.size() < 2) return nums.size();

        sort(nums.begin(), nums.end());

        int max = 0;
        int current = 0;

        for(int i = 0; i < nums.size() - 1; i++){
            if(nums[i + 1] == nums[i]){
                int tmp = nums[i];
                while(i < nums.size() - 2 && nums[i + 1] == tmp) i++;
            }
            
            if(nums[i + 1] - nums[i] == 1) current++;
            else{
                if(current + 1 > max) max = current + 1;
                current = 0;
            }
        }

        if(current + 1 > max) max = current + 1;

        return max;
    }
};

